import React, { Component } from "react";
import UserDataService from "../services/user.service";
import { Link} from "react-router-dom";
import "./maze.css"

export default class Prob1 extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    return (
      <div>
        <table>
          <tr>
            <td>
              <div className="story">
                <div className="marginbottom">스토리</div>
              </div>
            </td>
          </tr>
          <tr>
            <td>
              <hr className="hline"></hr>
            </td>
          </tr>
          <tr>
            <td>
              <div className="story">
                <div className="marginbottom">스토리</div>
              </div>
            </td>
            <td>              
              <Link to="/Home" className={'btn'}>이동</Link>
            </td>
          </tr>
        </table>        
      </div>
    );
  }
}
